import React from "react";

export const TransactionsCard = ({ name, amount, date }) => {
    return (
        <div className="transaction-card">
            <ul className="transaction-details">
                <li className="transaction-item">
                    <b>Name:</b> {name}
                </li>
                <li className="transaction-item">
                    <b>Amount:</b> {amount}
                </li>
                <li className="transaction-item">
                    <b>Date:</b> {date}
                </li>
            </ul>
        </div>
    );
};
